  [],\n\t\"revision_timestamp\": \"2015-05-07T02:05:30.995042\",\n\t\"name\": \"mls-aura-l2-ozone-o3-mixing-ratio-v002\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"ML2O3 is the EOS Aura Microwave Limb Sounder
  (MLS) standard product for ozone derived from radiances measured by the 240 GHz
  radiometer. The current version is 2.2. Spatial coverage is near-global (-82u00acu221e
  to +82u00acu221e latitude), with each profile spaced 1.5u00acu221e or ~165 km along
  the orbit track (roughly 15 orbits per day). The recommended useful vertical range
  is from 215 to 0.0215 hPa, and the vertical resolution is between 3 and 6 km. Users
  of the ML2O3 data product should read section 3.16 of the EOS MLS Level 2 Version
  2.2 Quality Document for more information (http://mls.jpl.nasa.gov/data/v2-2_data_quality_document.pdf).nn
  \     Users are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
  to obtain updates and information about this data product.nn      The data are stored
  in the version 5 EOS Hierarchical Data Format (HDF-EOS5), which is based on the
  version 5 Hierarchical Data Format, or HDF5. Each file contains two swath objects
  (one with profile data, the other with column data), each with a set of data and
  geolocation fields, swath attributes, and metadata. The data fields include the
  geophysical parameter values and precision (standard deviation), convergence values,
  data quality, and a status flag. The geolocation fields include a time stamp in
  TAI-93 format (seconds since January 1, 1993), geodetic latitude and longitude,
  and pressure level values, as well as local solar time, solar zenith angle, line
  of sight angle, and orbit geodetic angle. There is one file per day.\",\n\t\"license_title\":
